}

ServerProductPageQuery:
query ServerProductPageQuery($id: String!) {
  product(locator: [{key: "id", value: $id}]) {
    id: productID
    slug
    seo {
      title
      description
    }
    brand {
      name
    }
    sku
    gtin
    name
    description
    breadcrumbList {
      itemListElement {
        item
        name
        position
      }
    }
    image {
      url
      alternateName
    }
    offers {
      lowPrice
      highPrice
      priceCurrency
      offers {
        availability
        price
        priceValidUntil
        priceCurrency
        itemCondition
        seller {
          identifier
        }
        listPrice
      }
    }
    isVariantOf {
      productGroupID
      name
    }
  }
}

HomePageQuery:
query HomePageQuery {
  site {
    siteMetadata {
      title
      description
      titleTemplate
    }
  }
  allContentfulCommonQuestions(sort: {order: ASC, fields: createdAt}) {
    nodes {
      question
      answer {
        answer
      }
    }
  }
  allContentfulMainBanner {
    nodes {
      title
      subtitle
      imageDesktop {
